import React from 'react';
import { Link } from 'react-router-dom';

function Nav(){
    return (
        <nav>
            <h3>Logo</h3>
            <ul>
                <Link to='/log'>
                <li>Logg Inn</li>
                </Link>
                <Link>
                <li>Opprett Konto</li>
                </Link>
            </ul>
        </nav>
    );
}

export default Nav;
